import React, { useState } from 'react';
// import sections
import classNames from 'classnames';
import ButtonGroup from '../components/elements/ButtonGroup';
import Button from '../components/elements/Button';
import { SectionProps } from '../../utils/SectionProps';

const propTypes = {
    ...SectionProps.types
  }

  const defaultProps = {
    ...SectionProps.defaults
  }

  const Shop = ({
    className,
    topOuterDivider,
    bottomOuterDivider,
    topDivider,
    bottomDivider,
    hasBgColor,
    invertColor,
    ...props
  }) => {

    const [videoModalActive, setVideomodalactive] = useState(false);

    const openModal = (e) => {
      e.preventDefault();
      setVideomodalactive(true);
    }

    const closeModal = (e) => {
      e.preventDefault();
      setVideomodalactive(false);
    }   

    const outerClasses = classNames(
      'hero section center-content',
      topOuterDivider && 'has-top-divider',
      bottomOuterDivider && 'has-bottom-divider',
      hasBgColor && 'has-bg-color',
      invertColor && 'invert-color',
      className
    );

    const innerClasses = classNames(
      'hero-inner section-inner',
      topDivider && 'has-top-divider',
      bottomDivider && 'has-bottom-divider'
    );

    return (
      <section
        {...props}
        className={outerClasses}
      >
        <div className="container-sm">
          <div className={innerClasses}>
            <div className="hero-content">
              <h1 className="mt-0 mb-16 reveal-from-bottom" data-reveal-delay="200">
                Op zoek naar een <span className="text-color-primary">applicatie</span> voor uw bedrijf?
              </h1>
              <div className="container-xs">
                <p className="m-0 mb-32 reveal-from-bottom" data-reveal-delay="400">
                 Heeft u altijd al een mobiele applicatie voor zowel iOS en Android gewenst, dan bent u hier aan het juiste adres. Wij gaan samen met u kijken naar de mogelijkheden om uw bedrijf
                 te verbeteren doormiddel van een applicatie. 
                  </p>
                <div className="reveal-from-bottom" data-reveal-delay="600">
                  <ButtonGroup>
                    <Button tag="a" color="primary" wideMobile href="mailto:info@wheelzdev.nl">
                      Neem contact op
                      </Button>
                  </ButtonGroup>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }

  Shop.propTypes = propTypes;
  Shop.defaultProps = defaultProps;

export default Shop;
